import react from "react";

import ChartBar from ".ChartBar";


const Chart=(props)=>{
  return (
    <div>
        {props.dataPoint.map((dataPoint)=> <ChartBar value={dataPoint.value} label={dataPoint.label} key={dataPoint.label} maxValue={null} />)}
    </div>
  )


}

export default Chart;
